import React, {Component} from 'react';
import Link from 'next/link';
class Navbar extends Component{
    constructor(props){
        super(props);
        this.props = props;
    }
render(){

    return(
        <nav>
            <div>
                <Link href="/">

                        <a title="About home page">Home Page</a>  
                </Link>
                <Link href="/about">
                    <a title="Our Api">
                    About Next Js
                    </a>
                </Link>
                <mark className="badge">
                    Hello!
                </mark>
            </div>
        </nav>
    )

}
}

export default Navbar;
